import { ADD_DIARY, GET_DIARY } from '../actions/types';

const initialState = {
        diaries: [
            {  id: id,
               title: 'Hi',
               content: 'hoho',
               selectedHeart: 2, 
               date: new Date(),
               bodyChecked: 'Yes'
            }
        ]

}

export default function(state = initialState, action) {
   switch(action.type) {
       case GET_DIARY:
           return {
               ...state
           }
           default:
               return state;
   }
}
